import React from 'react';

// Components
import SleepingArrangementscard from '../presentational/SleepingArrangmentsCard';

export default () => {
  return (
    <div className='overflow-y-hidden'>
      <div className='w-full h-full overflow-y-hidden'>
        <div className='h-full scroller'>
          <div className='scrollable sm:inset-x-0 flex items-start justify-start py-2 rounded-xl w-featured w-full md:w-full'>
            <div className='mr-4 w-1/3 border border-gray-300 rounded-xl flex justify-start'>
              <SleepingArrangmentsCard />
            </div>
            <div className='mr-4 w-1/3 border border-gray-300 rounded-xl'>
              <SleepingArrangmentsCard />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
